Być może zwróciłeś uwagę, że powyższa zmienna $@ przechowuje wiele wartości na raz. Jest to przykład zmiennej tablicowej . Zmienne tablicowe przydają się gdy chcemy przechować wiele elementów (które mogą odpowiadać wielu zmiennym). Za chwilę wrócimy do nich przy okazji pętli. Na razie prosty przykład jak utworzyć taką zmienną i wypełnić ją danymi ( zmienne_tablicowe.sh ): #!/bin/bash # Tworzenie zmiennej tablicowej
sekwencje=(atp1 atp6 matR cox1) # Drukowanie na raz całej zawartości zmiennej tablicowej
echo ${sekwencje[@]} # Drukowanie kolejnych wartości
echo ${sekwencje[0]}
echo ${sekwencje[1]}
echo ${sekwencje[2]}
echo ${sekwencje[3]} W nawiasach kwadratowych znajduje się indeks (numer) wartości. Zauważ, że liczby zaczynają się od 0 a nie 1 . Wartość o indeksie 1 jest więc drugą a nie pierwszą. Znak @ lub * oznacza wszystkie wartości.
